/**
 * 操作数据库
 */
var i = 0;
var j = 0;

function criteSqllite_text(sql) {
	i++;
	//查找数据
	db.transaction(function(tx) {
		tx.executeSql(sql, [], function(tx, result) {
			j++;
			$('#footer').html('数据加载进度：' + j + '/' + i);
			if(i == j) {
				alert('初始化完成');
				$('#footer').html('数据加载完成！');
				console.log("加载完成！！！！！！！！");
			}
		}, function onError(tx, error) {
			console.log(sql);
			console.log(error.message);
		});
	});
}